import React, { Component } from 'react';
import Collapsible from 'react-collapsible';
 class Drinformation extends Component {
    constructor(props){
        super(props);
        this.state={
          doctors:[],
          isLoaded:false,

        };
    }

  componentDidMount(){
    fetch('https://api.betterdoctor.com/2016-03-01/doctors?first_name=Terry&user_key=ff5d654bef674612132ad54458bfb6a5')
    .then( res => res.json())
    .then(json => json.result.map(profile => ({
        name :`${profile.name.first_name}`,   
        gender :`${profile.gender}`, 
        location :`${profile.location.street},${profile.location.city}`
    }
    )))
    .then(doctors => this.setState({
        doctors, isLoaded:false
    }))

    .catch(error => console.log(error))}
    // window.initMap = this.initMap;
    // loadMap('https://maps.googleapis.com/maps/api/js?key=AIzaSyBRfODQceddU_9nyDJyCBQ5lSe20loOk2c&v=3&callback=initMap',function () { })



  render(){
      const {isLoaded,doctors}= this.state;
      return(
       <div>
        {   !isLoaded && doctors.length > 0? doctors.map(profile=>{
            const {name, location, gender}=profile;
            return <Collapsible key={name} title={name}>
            <p>{location}</p> <br/>
            <p>{gender}</p>
            </Collapsible> 
        }) : null

        }
       </div>
      );
    }
}

export default Drinformation;
